import { Subject, combineLatest, from, merge } from "rxjs";

import { downloadManagerSubscription } from "../transports/dashSegmentsBuilder";
import {
  IEmitterLoaderBuilder,
  IProgressBarBuilderDownload,
  ISettings,
  IContext,
  IContextRicher,
} from "../transports/types";
import { IUtils } from "./../../types";
import Manifest, { ISegment } from "../../../../../manifest";
import {
  mergeMap,
  reduce,
  tap,
  scan,
  filter,
  takeUntil,
  startWith,
} from "rxjs/operators";
import { SegmentPipelinesManager } from "../../../../../core/pipelines";
import { handleSegmentPipelineFromContexts } from "../transports/dashTools";

/**
 * A downloader that instanciate the event api and launch the downloadManager
 *
 * @param settings -
 * The settings that need the download manager depending if we are in resume or start mode
 * @param progressBuilderAssets -
 * The progressBuilder variables that are needed to construct the progress percentage
 * @param utils - Emitter and db instances
 * @returns The subscription of the observable
 *
 */
export function downloader(
  settings: ISettings,
  progressBuilderAssets: IProgressBarBuilderDownload,
  { db, emitter, storeManifestEvery }: any,
) {
  const {
    progressBarBuilder,
    progress$,
    pause$,
    activeSubsDownloader,
  } = progressBuilderAssets;
  let size = progressBuilderAssets.size;
  const contentID =
    settings.type === "start"
      ? settings.dbSettings.contentID
      : settings.contentID;

  const progressBuilder$ = new Subject<{
    nextSegments: ISegment[];
    id: string;
  }>();

  const builder$ = downloadManagerSubscription(
    {
      activeSubsDownloader,
      pause$,
      progress$,
      settings,
    },
    { emitter, db },
  ).pipe(
    reduce<
      {
        nextSegments: ISegment[];
        ctx: IContext;
        contentType: "video" | "audio" | "text";
        segmentPipelinesManager: SegmentPipelinesManager<any>;
      },
      {
        overall: number;
        video: IContextRicher[];
        audio: IContextRicher[];
        text: IContextRicher[];
        segmentPipelinesManager: SegmentPipelinesManager<any>;
        manifest: Manifest;
      }
    >(
      (
        acc,
        {
          nextSegments,
          ctx: { period, adaptation, representation, manifest },
          contentType,
          segmentPipelinesManager,
        },
      ) => {
        acc.overall += nextSegments.length;
        acc[contentType].push({
          nextSegments,
          period,
          adaptation,
          representation,
          id: representation.id as string,
        });
        return { ...acc, segmentPipelinesManager, manifest };
      },
      {
        overall: 0,
        video: [],
        audio: [],
        text: [],
        segmentPipelinesManager: {} as SegmentPipelinesManager<any>,
        manifest: {} as Manifest,
      }, // lié representation id à un ctx et un nextSegments.
    ),
    mergeMap(({ text, segmentPipelinesManager, manifest, overall }) => {
      return merge(
        from(text).pipe(
          mergeMap(values => {
            const { nextSegments, id, ...ctx } = values;
            return handleSegmentPipelineFromContexts(
              nextSegments.map(segment => ({ ...ctx, segment, manifest })),
              "text",
              {
                overall,
                nextSegments,
                segmentPipelinesManager,
                isInitData: false,
              },
            );
          }),
        ),
      );
    }),
    tap(async ({ chunkData, duration, index, representationID }) => {
      await db.put("segments", {
        contentID,
        data: chunkData,
        duration,
        segmentKey: `${representationID}--${contentID}--${index}`,
        size: chunkData.byteLength,
      });
    }),
    scan<
      {
        chunkData: Uint8Array;
        duration: number;
        ctx: IContext;
        index: number;
        contentType: "video" | "audio" | "text";
        representationID: string;
        isInitData: boolean;
        nextSegments?: ISegment[];
        overall?: number;
      },
      {
        progress: { percentage: number; current: number; overall: number };
        manifest: Manifest | null;
        video: IContextRicher[];
        audio: IContextRicher[];
        text: IContextRicher[];
        size: number;
      }
    >(
      (
        acc,
        {
          overall,
          ctx,
          contentType,
          nextSegments,
          representationID,
          chunkData,
        },
      ) => {
        acc.progress.current += 1;
        acc.size += chunkData.byteLength;
        if (overall) {
          acc.progress.overall = overall;
        }
        acc.progress.percentage =
          (acc.progress.current / acc.progress.overall) * 100;
        if (!nextSegments) {
          return acc;
        }
        const indexRepresentation = acc[contentType].findIndex(
          ({ representation }) => representation.id === representationID,
        );
        if (indexRepresentation === -1) {
          acc[contentType].push({
            nextSegments,
            period: ctx.period,
            adaptation: ctx.adaptation,
            representation: ctx.representation,
            id: representationID,
          });
          return { ...acc, manifest: ctx.manifest };
        }
        acc[contentType][indexRepresentation] = {
          nextSegments,
          period: ctx.period,
          adaptation: ctx.adaptation,
          representation: ctx.representation,
          id: representationID,
        };
        return { ...acc, manifest: ctx.manifest };
      },
      {
        progress: { percentage: 0, current: 0, overall: 0 },
        manifest: null,
        video: [],
        audio: [],
        text: [],
        size: 0,
      },
    ),
    takeUntil(pause$),
  );

  combineLatest([
    builder$.pipe(
      filter(({ progress: { percentage } }) =>
        storeManifestEvery && typeof storeManifestEvery === "function"
          ? storeManifestEvery(percentage) || percentage === 100
          : percentage % 10 === 0,
      ),
      startWith(null),
    ),
    pause$.pipe(startWith(null)),
  ]).subscribe(
    ([res]) => {
      if (res == null) {
        return;
      }
      const { progress, manifest, audio, video, text, size } = res;
      db.put("manifests", {
        contentID,
        manifest,
        audio,
        video,
        text,
        progressBuilder: progress,
        size,
        metaData:
          settings.type === "start"
            ? settings.dbSettings.metaData
            : settings.metaData,
      });
      console.warn(res.progress.percentage);
    },
    () => {},
    () => console.warn("complete"),
  );
}
